import React from 'react'
import {useState} from 'react';
import CareerList from '../CareerList/CareerList';
import "./Career.css";

import { featWorks, edu, proj, exp } from "../../data"

export default function Career() {

    const [selected, setSelected] = useState("top");
    const list = [
        {
            id: "top",
            name: "Top"
        },
        {
            id: "education",
            name: "Education"
        },
        {
            id: "projects",
            name: "Projects"
        },
        {
            id: "experience",
            name: "Experience"
        }
    ]

    return (
        <div className="career" id="career">
            <h1>Career</h1>
            <ul>
                {list.map(item=>(
                    <CareerList id={item.id} name={item.name} active={selected === item.id} setSelected={setSelected}></CareerList>
                ))}
            </ul>
            <div className="career-items">
                <div className="item">
                    <div className="placeholder"></div>
                    <h3>San Francisco State University</h3>
                </div>
                <div className="item">
                    <div className="placeholder"></div>
                    <h3>San Francisco State University</h3>
                </div>
                <div className="item">
                    <div className="placeholder"></div>
                    <h3>San Francisco State University</h3>
                </div>
                <div className="item">
                    <div className="placeholder"></div>
                    <h3>San Francisco State University</h3>
                </div>
            </div>
        </div>
    )
}
